pragma solidity >=0.5.12 <0.7.0;

import "./WhiteMange.sol";
import "./ResourceDB.sol";
import "./OrderDB.sol";

/**
 * @title 
 * @dev AdminOwner,ownerAdmin
 * @dev 
 *
 *  1. ResourceDB 
 *  2. ResourceDB 
 *  3. 
 *  4. OrderDB 
 *  5. 
 */
contract AdminModule is WhiteMange{
    ResourceDB public Resource_;
    OrderDB public Order_;
    //CenterPublish public Center;

    // constructor (address _resDb, address _orderDb, address _owner) public
    // {
    //     owner = _owner;
    //     Resource_ = ResourceDB(_resDb);
    //     Order_ = OrderDB(_orderDb);
    // }

      constructor (address _resDb, address _orderDb) public
    {
        // owner = msg.sender;
        // admin = msg.sender;
        emit  LogAddress("construcor",admin, owner,msg.sender);
        Resource_ = ResourceDB(_resDb);
        Order_ = OrderDB(_orderDb);
        admin = msg.sender;
    }

    event LogWhileChangedSuccess(bool success);

    /**
     * @dev    
     * @param  _contract address   : 
     * @param  _target   address   : 
     * @param  _allow    bool      : ture 
     */
    function mangeDestWhite(address _contract, address _target, bool _allow) public onlyAdmin
    {
        // 
        WhiteMange _destCon = WhiteMange(_contract);
         bool succ = false;
        if (_destCon.admin() != address(this)){
            emit LogError(RScorr.PermissionDenied);
            emit LogWhileChangedSuccess(succ);
            return ;
        }

        // "0xa8e1fba3": "mangeWhiteList(address,bool)"
        //return _contract.call(bytes4(0xa8e1fba3), _target, _allow); bool
        succ = _destCon.mangeWhiteList(_target, _allow);
        emit LogWhileChangedSuccess(succ);
    }

    /****************** Resource  ********************/
    /**
     * @dev    
     * @param  _resId  bytes16  : ID
     * @return           bool     : true
     */
    function deleteResource(bytes16 _resId) public onlyAdmin
        returns(bool)
    {
        return Resource_.deleteResource(_resId);
    }


    /**
     * @dev    ResourceDB
     * @param  _newResourceDB address  : claimDB
     * @return             bool     :  true
     */
    function changeResourceDB(address _newResourceDB) public onlyAdmin returns(bool)
    {
        require(_newResourceDB != address(0)," _newResourceDB == 0");
        Resource_ = ResourceDB(_newResourceDB);
        return true;
    }

    /****************** Order  ********************/

    /**
     * @dev    
     * @param  _orderId  bytes32  :  ID
     * @return           bool     :  true
     */
    function deleteOrder(bytes32 _orderId) public onlyAdmin returns(bool)
    {
        return Order_.remove(_orderId);
    }

    /**
     * @dev    OrderDB
     * @param  _newOrderDB address :  orderDB
     * @return             bool    :  true
     */
    function changeOrderDB(address _newOrderDB) public onlyAdmin
        returns(bool)
    {
        require(_newOrderDB != address(0),"_newOrderDB == 0");
        Order_ = OrderDB(_newOrderDB);
        return true;
    }

    /****************** Info  ********************/

    // Null


    /****************** center  ********************/


    // admin

    /**
     * @dev 
     * @notice owner
     * @param _newAdmin address   : 
     * @param _contract address[] : 
     * @return          bool      true
     */
    function migrate(address _newAdmin, address[] memory _contract) public onlyOwner
        returns(bool)
    {
        uint256 _len = _contract.length;
        for (uint256 i = 0; i < _len; i++){
            WhiteMange _addr = WhiteMange(_contract[i]);
            require(_addr.admin() == address(this), "Sorry, you entered an invalid contract address");
            _addr.transferAdminship(_newAdmin);
        }
    }

    /**
     * @dev 
     * @param _contract address : 
     * @return          bool    : amdintrue
     */
    function isAdmin(address _contract) public view  returns(bool){
        if (WhiteMange(_contract).admin() == address(this)){
            return true;
        }else{
            return false;
        }

    }
}
